DROP TABLE IF EXISTS `is_address`;
CREATE TABLE `is_address` (
  `id` varchar(54) NOT NULL COMMENT '地址编号',
  `owner` varchar(54) DEFAULT NULL,
  `user_id` varchar(54) DEFAULT NULL COMMENT '买家编号',
  `contact_user_name` varchar(64) DEFAULT NULL COMMENT '收货人',
  `region` varchar(64) DEFAULT NULL COMMENT '收货区域',
  `address` varchar(128) DEFAULT NULL COMMENT '详细地址',
  `zip` varchar(32) DEFAULT NULL COMMENT '邮编',
  `phone_no` varchar(32) DEFAULT NULL COMMENT '联系电话',
  `is_default` smallint(6) DEFAULT NULL COMMENT '是否默认 1.是 2.否',
  `cert_type` smallint(6) DEFAULT NULL COMMENT '证件类型：1身份证、2护照 3 军官证',
  `cert_code` varchar(20) DEFAULT NULL COMMENT '证件号',
  `cardfront_img` varchar(128) DEFAULT NULL COMMENT '证件照正面',
  `cardback_img` varchar(128) DEFAULT NULL COMMENT '证件照反面',
  `status` smallint(6) DEFAULT NULL COMMENT '状态 ： 1.正常  0：删除',
  `is_type` int(11) DEFAULT NULL COMMENT '地址所属: 1.企业 2.用户',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

