DROP TABLE IF EXISTS `sys_func`;
CREATE TABLE `sys_func` (
  `Id` varchar(12) NOT NULL COMMENT '功能编号',
  `parent_id` varchar(10) NOT NULL COMMENT '父功能编号',
  `types` smallint(6) DEFAULT '1' COMMENT '0 共享功能 1 后台默认功能 2 前台shop功能 3 xms功能',
